import React from 'react';
import { Container } from 'react-bootstrap';

const DeliveryInfo = () => {
    return (
        <Container fluid>
            <Container>
                <Nav className="justify-content-center font-weight-bold p-5" activeKey="/home">
                    <Nav.Item>
                        <Link className="navLink mr-3" to="/">Breakfast</Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Link className="navLink mr-3" to="/" >Lunch</Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Link className="navLink mr-3" to="/">Dinner</Link>
                    </Nav.Item>
                </Nav>
                   
            </Container>
        </Container>
    );
};

export default DeliveryInfo;
